window.bookSummaryJSON = "<p>Claim an inheritance.</p> <p>It's a simple goal, right?</p> <p>Nothing is simple when Cole returns to Centauri, the seat of Coleson Interstellar Engineering.&nbsp;Challenges at every turn, with no idea who he can trust.&nbsp;And then...the Solar Republic gets involved.</p> <p>Will Cole find the people working against him in time?&nbsp;Will they succeed in ending the Coleson line once and for all?</p> <p>Listen now to find out!</p>"; 
